import React from "react";
import { Avatar } from "@material-ui/core";

export default function AvatarCollection(props) {
	const { amount } = props;
	let res = null;
	for (let i = 0; i < amount; i++) {
		res = res + <Avatar></Avatar>;
	}
	return <div>{res}</div>;
}
